import React from "react";
import { Button } from "shards-react";

function submitForm() {
  console.log("hello");
}

class SubmitButton extends React.Component {
  submitForm() {
    console.log("hello there");
  }

  render() {
    return (
      <Button onClick={submitForm} theme="dark">
        <p>&#128640; Submit</p>
      </Button>
    );
  }
}

export default SubmitButton;
